import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import React, {useState} from "react";
import { Form, Input, Checkbox, Button, Col, Divider } from "antd";
import { Layout } from 'antd';
const {Header, Content, Footer} = Layout;

const columns = [
    {
        title: "Mã nhân viên",
        dataIndex: "MaNV",
        key: "MaHD"
    },
    {
        title: "Họ tên",
        dataIndex: "Ten",
        key: "TinhTrang"
    },
    {
        title: "Giới tính",
        dataIndex: "GioiTinh",
        key: "GioiTinh"
    },
    {
        title: "Ngày Sinh",
        dataIndex: "",
        key: "MaNVGH"
    }
]

const QlNhanVien = () => {
    const [listNV, setListNV] = useState([]);

    useEffect(() => {
      axios
        .get("http://localhost:5000/api/NVQL/dsnv/" + JSON.parse(window.localStorage.getItem("NVGH")))
        .then((res) => {
            setListNV(res.data);
        })
        .catch((err) => {
          console.log(err);
        });
    }, []);
    return(
    <div>
            <Layout>
                <Content>
                    <Title level={2} classname="titlename">
                    Danh sách đơn hàng
                    </Title>
                    <Table columns={columns} dataSource={listNV}/>
                </Content>
            </Layout>
    </div>
    );
}
export default QlNhanVien;
